import React from "react";

const Listing = ({ data, tags, updateFilters, key }) => {
  const listingTags = tags.map((tag) => <span>{tag}</span>);

  return (
    <article className='listing' key={key}>
      <div className='listing__img'></div>
      <div className='listing__info-wrapper'>
        <div className='listing__info'>
          <h3 className='listing__title'>{data.position}</h3>
          <div className='listing__info-company'>
            <span className='listing__comp-name'></span>
            {data.new ? <span className='listing__new-tag'>new!</span> : null}
            {data.featured ? (
              <span className='listing__new-tag'>featured</span>
            ) : null}
          </div>
        </div>
        <div className='listing__tags'>{listingTags}</div>
      </div>
    </article>
  );
};

export default Listing;
